import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-consultar-reportes',
  templateUrl: './consultar-reportes.component.html',
  styleUrls: ['./consultar-reportes.component.scss']
})
export class ConsultarReportesComponent {
  folio = '';

  constructor(private router: Router) { }

  buscar() {
    this.router.navigate(['/resultado-reporte', this.folio]);
  }
}
